import React from "react";
import second from './'

function FloatingDiv({ image, txt1, txt2 }) {
  return (
    <>
      <div className="floatingdiv">
        <img src={image} alt="" />
        <span>
          Web
          <br />
          Developer
        </span>
      </div>
    </>
  );
}

export default FloatingDiv;
